import React from "react";
import {NavLink} from 'react-router-dom';

const Navbar = () => {
    return (
        <div>
            <NavLink to="/Home">Home</NavLink>
            <NavLink to="/DogGallery">Dog Gallery</NavLink>
            <NavLink to="/AboutUs">About Us</NavLink>
        </div>
    );
};

export default Navbar;
